  justify-content: center;
`;

export const MessageContainer = styled.section``;

export const Title = styled.p`
  font-size: 24px;
  font-weight: 700;
`;

export const Text = styled.span`
  font-size: 16px;
  color: '#807D7D';
  font-weight: 400;
`;
